class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        s_list = list(s)
        max_list = []
        max_length = 0
        i = 0
        
        s_list = list(s)
        f_max_length = len(list(set(s_list)))
        if s_list == list(set(s_list)):
            max_length = len(s_list)
        for w in range(len(s_list)):
            i = w
            max_list = []
            while i < len(s_list):
                if not max_list.count(s_list[i]):
                    max_list.append(s_list[i])
                    print(s_list[i], max_list, max_length, i)
                    i+=1
                else:
                    max_length = max([max_length, len(max_list)])
                    print(s_list[i], max_list, max_length, i)
                    max_list = []
                if max_length==f_max_length:
                    return f_max_length
                max_length = max([max_length, len(max_list)])
        print(max_length)
        return max_length
        

